import imgAPI from '~/public/images/imgAPI';

module.exports = {
  profile: {
    name: 'Natalia Sergeeva',
    title: 'Front End Developer & Designer',
    desc: 'Front End Developer & Designer profile page',
    prefix: 'Sergeeva',
    footerText: 'Natalia Sergeeva 2021',
    logoText: 'Natalia Sergeeva',
    projectName: 'Profile',
    url: 'luxireact.ux-maestro.com/profile',
    img: '/images/profile-logo.png',
    avatar: imgAPI.profile[1],
    cover: imgAPI.profile[0],
    notifMsg: ''
  }
};
